import {useState} from 'react';

const Todos = () => {
    const [todos, setTodos] = useState([])

    const get_all_todos = () => {
        let url = "https://jsonplaceholder.typicode.com/todos";
        fetch(url, {
            method: "GET"
        }).then(response => response.json()).then(res => {
            setTodos(res);
        })
    }

    return (
        <h1>Todos</h1>
    )
}

export default Todos;
